'use strict';

class PokidexData {
  static makeIndex(ary, ref) {
    const index = {};
    for (let i = 0; i < ary.length; i++) {
      const e = ary[i];
      if (e != null) {
        index[ref(e)] = e;
      }
    }
    return index;
  }

  toString() {
    return `[${this.constructor.name} ${this.name}]`;
  }
}

